fr:
  title: 'Pays-Bas : mise à jour'
  body: >-
    Très ouvert sur l'international, les Pays-Bas forment un pays très développé
    et qui se situe au coeur de l'Europe. Très urbanisé, très plat, très
    en-dessous du niveau de la mer, contrairement à toute attente, c'est le pays
    des superlatifs !  <br />
